// App.js
import React, { useState } from "react";
import Message from "./hero";

function App() {
  const [count, setCount] = useState(0);

  return (
    <div>
      <h1>Parent Controlled Child Example</h1>
      <p>Count: {count}</p>

      <Message
        text="Increment"
        onClick={() => setCount(count + 1)}
        user={{ name: "Kanwar", role: "Developer" }}
      />

      <Message
        text="Reset"
        onClick={() => setCount(0)}
        user={{ name: "John", role: "Designer" }}
      />

      {/* This one has no user prop */}
      <Message text="No User" onClick={() => alert("Hello")} />
    </div>
  );
}

export default App;
